/**
 * @typedef Cron
 * @property {string} interval
 * @property {{ name: string, value: string }[]} [tags]
 *
 * @param {Cron} cron
 * @returns {{ name: string, value: string }[]}
 */
export function serializeCron(cron: Cron): {
    name: string;
    value: string;
}[];
export type Cron = {
    interval: string;
    tags?: {
        name: string;
        value: string;
    }[];
};
